import React from 'react';

function Jumbotron() {
    return (
    <div className='jumbotron jumbotron-fluid bg-info text-white text-center'>
        <h1 className='display-1'>
            Google Book Search
        </h1>
        <h2 className='lead'>
            Find and save your favorite books
        </h2>
    </div>
    )
}

export default Jumbotron;
